import logo from '../resources/apex_logo.svg';
import '../App.css';

function Header(props) {
    botItems = props.bots.map(name => {
        <a href="#">{name}</a>
    });
    return (
        <header className="App-header">
            <img src={logo} className="App-logo" alt="logo"/>
            <p>
                ApexBots
            </p>
            <br/>
            <div>
                {botItems}
            </div>
        </header>
    );
}

export default Header;
